import React from 'react';
import { compose } from 'redux';
import { reduxForm, Field } from 'redux-form';

const SignInForm = ({ handleSubmit, onCancel, pristine, submitting, valid }) => {
    
    return (
        <form onSubmit={handleSubmit(val => console.log(val))}>
        <Field
          name="login"
          type="text"
          component="input"
          placeholder="Login"
          label="Login"
        />
        <Field
          name="password"
          type="text"
          component="input"
          placeholder="Password"
          label="Password"
        />
        <button type="button" onClick={onCancel} color="primary">
          CANCEL
        </button>
        <button type="submit" disabled={!valid || pristine || submitting}>
          SUBMIT
        </button>
      </form>
    );
}

export default compose(
    reduxForm()
)(SignInForm);
